import React from 'react';
import { Layout } from './Layout';
import { useRoute } from '@react-navigation/native';

export const Error = () => {
    const route:any = useRoute();
    const errorMessage = route.params.error;
    
    return <Layout errorMessage={errorMessage}/>
}
